import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

//import reportWebVitals from './reportWebVitals';
import {BrowserRouter} from "react-router-dom";

ReactDOM.render(
<>
<BrowserRouter>

    <App />
    <Home/>
    <About/>
    <Contact/>
    <Service></Service>
    </BrowserRouter>
   </>,
  document.getElementById('root') 

);
